import React from 'react';
import Todos from './components/Todos';

import './App.css';

function App() {
  React.state = {
    todos: [
      {
        id: 1,
        title: 'Take out the trash',
        completed: false
      },
      {
        id: 2,
        title: 'Dinner with Friend',
        completed: false
      },
      {
        id: 3,
        title: 'Meet with Client',
        completed: false
      }
    ]
  }

  return (
    <div className="App">
     <Todos />
    </div>
  );
}


export default App;
